		var offsets1 = $('#s1').offset();
		
		var round1 =Math.round( offsets1.top);
		console.log(round1-height);
	 	if((round1-height<150 && round1-height>-3500)) {

			
			$('.dot1').addClass('active1');

		} else {

			
			$('.dot1').removeClass('active1');
		}

		/************************For dot2*****=>section 5**************/

		var offsets2 = $('#s5').offset();
		
